class Block {
	constructor() {
		console.log('hi');
	}

	get classes() {
		return {
			block: 'block',
			row: 'block__row',
			img: 'block__img',
			button: 'block__button',
			name: 'block__name',
			description: 'block__description',
		};
	}

	createBlock({ img, name, url, description }) {
		const block = this.createBlockElement();
		const blockRow = this.createRowElement();

		blockRow.appendChild(this.createImgElement(img));
		blockRow.appendChild(this.createButtonElement(url));

		const blockName = this.createTextElement(name, this.classes.name);
		const blockDescription = this.createTextElement(
			description,
			this.classes.description
		);

		block.appendChild(blockRow);
		block.appendChild(blockName);
		block.appendChild(blockDescription);

		return block;
	}

	createDiv() {
		return document.createElement('div');
	}

	createBlockElement() {
		const element = this.createDiv();
		element.className = this.classes.block;

		return element;
	}

	createRowElement() {
		const element = this.createDiv();
		element.className = this.classes.row;

		return element;
	}

	createImgElement(data) {
		const element = new Image();
		element.src = data;
		element.className = this.classes.img;

		return element;
	}

	createButtonElement(url) {
		const element = document.createElement('button');

		element.className = this.classes.button;
		element.innerText = 'играть';
		element.onclick = () => {
			window.open(url, "_self");
		};

		return element;
	}

	createTextElement(text, className) {
		const element = this.createDiv();
		element.innerText = text;
		element.className = className;

		return element;
	}
}

const listNode = document.getElementById('list');
const blockCreator = new Block();

blockConfigs.forEach((config) => {
	const block = blockCreator.createBlock(config);
	listNode.appendChild(block);
});
